const Main = () => {
  return (
    <main className="main">
      <div className="container">
        <div className="sec-one">
          <img
            className="svg-img"
            src="images/undraw_toy_car_7umw.svg"
            alt=""
          />
          <p>اعتنو باطفالكم من خلال الموقع سنرشدكم الى الطريق الصحيح </p>
        </div>
        <div className="cards">
          <div className="card"></div>
          <div className="card"></div>
          <div className="card"></div>
        </div>
      </div>
    </main>
  );
};
export default Main;
